package unpass

import "fmt"

/*
给定一个字符串，请你找出其中不含有重复字符的 最长子串 的长度。

示例 1:

输入: "abcabcbb"
输出: 3
解释: 因为无重复字符的最长子串是 "abc"，所以其长度为 3。
示例 2:

输入: "bbbbb"
输出: 1
解释: 因为无重复字符的最长子串是 "b"，所以其长度为 1。
示例 3:

输入: "pwwkew"
输出: 3
解释: 因为无重复字符的最长子串是 "wke"，所以其长度为 3。
     请注意，你的答案必须是 子串 的长度，"pwke" 是一个子序列，不是子串。
 */
func lengthOfLongestSubstring(s string) int {
	if len(s) == 0 {
		return 0
	}


	return isUniString(s)
}

func isUniString(str string) int {
	flag := make(map[string][]int)

	for i, c := range str {
		if v, ok := flag[string(c)];ok {
			v = append(v, i)
			flag[string(c)] = v
		} else {
			flag[string(c)] = []int{i}
		}
	}

	max := 0
	tmp := 0

	for _, v := range flag{
		tmp = getMaxV(v)

		if tmp > max {
			max = tmp
		}
	}
	return max
}

func getMaxV(ints []int) int  {

	if len(ints) <= 1{
		return len(ints)
	}
	max := 0
	tmp := 0

	for i := 0; i< len(ints)-1 ; i++ {
		if ints[i+1] > ints[i] {
			tmp = ints[i+1]-ints[i]
		} else {
			tmp = ints[i]-ints[i-1]
		}

		if tmp > max {
			max = tmp
		}
	}

	return max
}

